import React from 'react';
import Menu from 'Menu';

export default class MenuList extends React.Component {
  render() {
	const {menus} = this.props;
    return(
	  <ul>
		<li><Menu menu={menus[0]} /></li>
		<li><Menu menu={menus[1]} /></li>
		<li><Menu menu={menus[2]} /></li>
	  </ul>
	)
  }
}
